import React from 'react';
import {Card , CardBody, CardText,CardFooter} from 'reactstrap';
const Home = () => {
    return (
        <div>
            <Card>
                <CardBody>
                    <CardText>
                        Hello world
                    </CardText>
                </CardBody>
            </Card>
            
        </div>
    )
}

export default Home
